<?phpnamespace LinkSoft\Source;interface F10Interface{    /**     * 公司公告.     * @param string $market 证券市场     * @param string $symbol 股票代码     * @param int $page 页数     * @param int $pageSize 每页数量     * @return array     */    public function notice(string $market, string $symbol, int $page, int $pageSize): array;    /**     * 证券新闻.     * @param string $market 证券市场     * @param string $symbol 股票代码     * @param int $page 页数     * @param int $pageSize 每页数量     * @return array     */    public function news(string $market, string $symbol, int $page, int $pageSize): array;    /**     * 证券新闻.     * @param int $type     * @param string $market 证券市场     * @param string $instrument     * @param string $startDate     * @param string $endDate     * @param bool $isShowContent     * @param string $channel     * @param int $page 页数     * @param int $pageSize 每页数量     * @return array     */    public function newsV2(int $type, string $market, string $instrument, string $startDate, string $endDate, bool $isShowContent, string $channel, int $page, int $pageSize): array;    /**     * 公司新闻详情.     * @param string $id id     * @return array     */    public function newsInfo(string $id);    /**     * 公司简况.     * @param string $market 证券市场     * @param string $symbol 股票代码     * @param string $securityType 证券类型     * @return array     */    public function company(string $market, string $securityType, string $symbol): array;    /**     * 分红派息.     * @param string $market 证券市场     * @param string $symbol 股票代码     * @param string $securityType 证券类型     * @param string $startDate 开始时间     * @param string $endDate 结束时间     * @return array     */    public function dividend(string $market, string $securityType, string $symbol, string $startDate, string $endDate): array;    /**     * 利润表.     * @param string $market 证券市场     * @param string $securityType 证券类型     * @param string $symbol 股票代码     * @param string $startDate 开始时间     * @param string $endDate 结束时间     * @param string $period 1：1季报 2：2季度 3：3季报 4：年报 仅美股（5：2季报累计 6：3季报累计） 不传即所有     * @return array     */    public function profit(string $market, string $securityType, string $symbol, string $startDate, string $endDate, string $period): array;    /**     * 现金流量表.     * @param string $market 证券市场     * @param string $securityType 证券类型     * @param string $symbol 股票代码     * @param string $startDate 开始时间     * @param string $endDate 结束时间     * @param string $period 1：1季报 2：2季度 3：3季报 4：年报 仅美股（5：2季报累计 6：3季报累计） 不传即所有     * @return array     */    public function flow(string $market, string $securityType, string $symbol, string $startDate, string $endDate, string $period): array;    /**     * 资产负债表.     * @param string $market 证券市场     * @param string $securityType 证券类型     * @param string $symbol 股票代码     * @param string $startDate 开始时间     * @param string $endDate 结束时间     * @param string $period 1：1季报 2：2季度 3：3季报 4：年报 仅美股（5：2季报累计 6：3季报累计） 不传即所有     * @return array     */    public function asset(string $market, string $securityType, string $symbol, string $startDate, string $endDate, string $period): array;    /**     * 拆股合股     * @param string $market 证券市场     * @param mixed $securityType     * @param mixed $symbol     * @param mixed $startDate     * @param mixed $endDate     * @return array     */    public function splits(string $market, string $securityType, string $symbol, string $startDate, string $endDate): array;    /**     * 分红派息 - 指定日期     * @param string $market 证券市场     * @param string $searchDate 查询日期     * @return array     */    public function appointDividend(string $market, string $searchDate): array;    /**     * 拆股合股 - 指定日期     * @param string $market 证券市场     * @param string $searchDate 查询日期     * @return array     */    public function appointSplits(string $market, string $searchDate): array;    /**     * 股票变更 - 指定日期     * @param string $market 证券市场     * @param string $searchDate 查询日期     * @return array     */    public function appointChange(string $market, string $searchDate): array;    /**     * 分布及流向.     * @param string $market 证券市场     * @param string $securityType 证券类型     * @param string $symbol 股票代码     * @return array     */    public function distAndFlow(string $market, string $securityType, string $symbol): array;}